pragma solidity ^0.5.8;
pragma experimental ABIEncoderV2;

import "./tokenErc20.sol";

contract ProxyErc20 {

    address erc20;
    uint8 version;
    address created_by;
    address last_upd_by;
    uint created_at;
    uint last_upd_at;
    address [] arrayAdd;
    address [][] alowance;

    constructor(address erc20_) public {
        erc20 = erc20_;
        version =1;
        created_by = msg.sender;
    	last_upd_by = msg.sender;
    	created_at = now;
    	last_upd_at = now;
    	TokenErc20 token = TokenErc20(erc20);
    	arrayAdd.push(msg.sender);
    }

    function getNameSymbolSupply() public view returns (string memory, string memory, uint256, uint8, address, address, uint, uint){
    	TokenErc20 token = TokenErc20(erc20);
    	string memory name = token.getName();
    	string memory symbol = token.getSymbol();
    	uint256 supply = token.getTotalSupply();

    	return (name, symbol, supply, version, created_by, last_upd_by, created_at, last_upd_at);
    }

    function getAddBalances() public view returns(address [] memory) {
    	return arrayAdd;
    }

    function getBalance(address add) public view returns(uint256) {
    	TokenErc20 token = TokenErc20(erc20);
    	return token.balanceOf(add);
    }

    function setBalance(address add, uint256 amount) public returns(bool) {
    	TokenErc20 token = TokenErc20(erc20);
    	bool result = token.setBalanceOf(add, amount);
    	return result;
    }

    function setAllowance(address delegate, uint256 numOfTokens) public returns(bool) {
    	alowance.push([msg.sender, delegate]);
    	TokenErc20 token = TokenErc20(erc20);
    	bool result = token.approve(delegate, numOfTokens);
    }

    function getAllowance() public view returns(address [][] memory) {
    	return alowance;
    }
}
